<html lang="en">
<head>
  <meta charset="UTF-8" />
  <meta name="viewport" content="width=device-width, initial-scale=1.0" />
  <title>Installation Certificate</title>
  <style>
    @page { size: A4; margin: 0; }
    html, body { margin: 0; padding: 0; font-family: 'Times New Roman', serif; }
    .page {
      width: 210mm; height: 297mm; box-sizing: border-box; position: relative; overflow: hidden; background: #fff;
    }
    .page img.bg { position: absolute; inset: 0; width: 100%; height: 100%; object-fit: cover; z-index: 0; }
    .layer { position: absolute; inset: 0; z-index: 1; }
    
    /* Customer name - positioned on the line after "THIS CERTIFICATE IS PRESENTED TO" */
    .customer-name {
      position: absolute;
      top: 152mm;
      left: 50%;
      transform: translateX(-50%);
      font-size: 40px;
      font-weight: bold;
      color: #2c5aa0;
      text-transform: uppercase;
      letter-spacing: 2px;
      text-align: center;
      width: 160mm;
    }
    
    /* Date - positioned in the recognition text where the blank is */
    .install-date {
      position: absolute;
      top: 172mm;
      left: 50%;
      transform: translateX(-50%);
      font-size: 18px;
      font-weight: bold;
      color: #2c5aa0;
      text-align: center;
    }
    
    /* Capacity - positioned after "WITH A CAPACITY OF" */
    .capacity {
      position: absolute;
      top: 182mm;
      left: 50%;
      transform: translateX(-50%);
      font-size: 18px;
      font-weight: bold;
      color: #2c5aa0;
      text-align: center;
    }
  </style>
</head>
